import React from "react";

function Text () {
    return(
       <p> In the quiet corners of the quaint town, where time seemed to linger lazily, an old bookstore stood with its weathered facade and a charming jingle that welcomed visitors into a world of literary treasures. The scent of aged paper and the soft rustle of turning pages filled the air, creating a comforting symphony for those seeking refuge from the bustling outside world. As the afternoon sun painted warm hues across the cobblestone streets, a curious cat lounged in the bookstore window, indifferent to the passage of time and content in the magic woven between the shelves of forgotten stories and well-worn classics.
       </p>
    )
}

export default Text ;
